import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import { clearCurrentToken } from './api'


import {
    BrowserRouter as Router,
    Route,
    Link,
    Redirect,
    Switch
} from 'react-router-dom';

import {
    Register,
    Login
} from './components';


const App = () => {

//use states
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [confirmedPassword, setConfirmedPassword] = useState('');


    return (
        <Router>

        <div className="app">
            <header className="fixedheader">
                <h1>Health Hub</h1>
                <nav>
                    <Link to='/home'>Home</Link>
                    <Link to='/routines'>Fitness Routines</Link>
                    <Link to='/myroutines'>My Routines</Link>
                    <Link to='/activities'>Activities</Link>
                    <Link to='/register'>Register</Link>
                    <Link to='/login'>Login</Link>
                    <Link to='/' onClick={() => clearCurrentToken()}>Logout</Link>
                </nav>
            </header>
            <div className="headerspacer"></div>
            <main>
            <Switch>

                <Route exact path='/home'>
                    <h1 className="homepage">Welcome to Health Hub!</h1>
                    <h2 className="homepage">Find, create, and save fitness routines for a healthier lifestyle.</h2> 
                    <h2 className="homepage">Click the links above to navigate.</h2>
                </Route>

                <Route exact path='/register'>
                    <Register username={username} setUsername={setUsername} password={password} setPassword={setPassword} 
                    confirmedPassword={confirmedPassword} setConfirmedPassword={setConfirmedPassword}/>
                </Route>

                <Route exact path='/login'>
                    <Login username={username} setUsername={setUsername} password={password} setPassword={setPassword} 
                    confirmedPassword={confirmedPassword} setConfirmedPassword={setConfirmedPassword}/>
                </Route>


            </Switch>
            </main>
    </div>
    </Router>
    )
}


ReactDOM.render(
    <Router>
         <App />
    </Router>,
    document.getElementById('app'),
  )
